import EventDetailPage from "./EventDetailPage";

const EVENTS = [
    {id: 'e1', title:'Evento 1'},
    {id: 'e2', title:'Evento 2'},
    {id: 'e3', title:'Evento 3'},
]

const EventsPage = () => {

    return (
        EVENTS.map( (event) => {
            return <Link to={`/${event.id}`}>{event.title}</Link>
        })
    );
}

export default EventsPage
